:10:17','Delta Air Lines will begin nonstop shuttle service between Los Angeles and San Francisco in September with a few California touches.',1),(4324,14,15,182,'ae3fc8309aa4bf91673efc17321b03391a3ff8f3','ArtsBeat: New York Fringe Festival Report: ‘The Spider’','By SCOTT HELLER','http://artsbeat.blogs.nytimes.com/2013/08/18/new-york-fringe-festival-report-the-spider/?partner=rss&emc=rss','http://artsbeat.blogs.nytimes.com/2013/08/18/new-york-fringe-festival-report-the-spider/','\0','2013-08-18 20:00:50','2013-08-19 10:10:18','Existential echoes of Beckett and Sartre are in the air in “The Spider,” a Bulgarian play that completed its North American premiere run.',1),(4325,14,22,177,'11fa2de3c84085b6c1c15b050833d4f2eabcc92a','An American Coach in London','By JACK BELL','http://www.nytimes.com/2013/08/09/sports/soccer/an-american-coach-in-london.html?partner=rss&emc=rss','http://www.nytimes.com/2013/08/09/sports/soccer/an-american-coach-in-london.html','\0','2013-08-08 17:44:49','2013-08-19 10:10:15','NBC begins carrying games from England’s Premier League on Aug. 17 and sent a “football coach” to work with Tottenham Hotspur.',1),(4326,14,26,181,'a7bb505fceb8ca234b4423c56ba151f89e1b4112','In Transit Blog: Ace Plans to Open Luxury Hotel in Panama','By STEPHEN HEYMAN','http://intransit.blogs.nytimes.com/2013/08/12/ace-plans-to-open-luxury-hotel-in-panama/?partner=rss&emc=rss','http://intransit.blogs.nytimes.com/2013/08/12/ace-plans-to-open-luxury-hotel-in-panama/','\0','2013-08-13 17:01:07','2013-08-19 10:10:17','Ace Hotels plans to open a luxury project in November in the Casco Viejo neighborhood in Panama City.',1),(4327,14,59,176,'5235ec11ddeb1a1de1feaa94eb8705418ebde67d','Sports Briefing | Hockey: Islanders and Bailey Agree to Five-Year Deal','By THE ASSOCIATED PRESS','http://www.nytimes.com/2013/07/16/sports/hockey/islanders-and-bailey-agree-to-five-year-deal.html?partner=rss&emc=rss','http://www.nytimes.com/2013/07/16/sports/hockey/islanders-and-bailey-agree-to-five-year-deal.html','\0','2013-07-16 05:34:35','2013-08-19 10:10:13','The Islanders agreed to terms with the restricted free agent forward Josh Bailey on a five-year, $16.5 million deal.',1),(4328,14,25,178,'484171539206faa5eac5230e669aa302999bc968','Korda’s Father Knows the Pressure of Playing for Country','By KAREN CROUSE','http://www.nytimes.com/2013/08/16/sports/golf/kordas-father-knows-the-pressure-of-playing-for-country.html?partner=rss&emc=rss','http://www.nytimes.com/2013/08/16/sports/golf/kordas-father-knows-the-pressure-of-playing-for-country.html','\0','2013-08-16 02:25:58','2013-08-19 10:10:17','Of all the Solheim Cup parents, nobody has more wisdom to impart than Jessica Korda’s father, Petr Korda, who compiled a 29-13 record in Davis Cup competition.',1),(4329,14,15,182,'37c77e2d468fb0f9f7daadf5525ba8312af49f6f','Texas Monthly: A Musical Switch From Self-Pity to Gratitude','By ANDY LANGER','http://www.nytimes.com/2013/08/18/us/a-musical-switch-from-self-pity-to-gratitude.html?partner=rss&emc=rss','http://www.nytimes.com/2013/08/18/us/a-musical-switch-from-self-pity-to-gratitude.html','\0','2013-08-17 23:38:43','2013-08-19 10:10:18','The new album by Blue October, “Sway,” is less about the specifics of a band member’s recovery from addiction to alcohol and prescription pills than it is about hope.',1),(4330,14,26,181,'f8143ec0af5e3d4484479a160098939bf1f080ee','Update: Mount Fuji, So Popular It Hurts','By KEN BELSON','http://travel.nytimes.com/2013/08/18/travel/mount-fuji-so-popular-it-hurts.html?partner=rss&emc=rss','http://travel.nytimes.com/2013/08/18/travel/mount-fuji-so-popular-it-hurts.html','\0','2013-08-13 14:57:06','2013-08-19 10:10:17','The vexing challenge of protecting Japan’s most recognizable natural landmark grows more intense as Mount Fuji is added to Unesco’s World Heritage list.',1),(4331,14,15,182,'df214f7a8dcac2e0a3b8a7c8c32778ffea9daab3','Haji, an Actress Featured in Cult Films by Russ Meyer, Dies at 67','By DANIEL E. SLOTNIK','http:/