a: Most Guns at the Airport','By MIKE TIERNEY','http://www.nytimes.com/2013/08/13/business/forgotten-firearms-found-by-airport-security.html?partner=rss&emc=rss','http://www.nytimes.com/2013/08/13/business/forgotten-firearms-found-by-airport-security.html','\0','2013-08-12 21:29:49','2013-08-19 10:10:17','Security agents at American airports have confiscated more than 800 guns so far in 2013, setting a pace that is likely to beat last year’s record of 1,556.',1),(4336,14,15,182,'46768ec6adb4f979295d61d36a4e40df7ad9d629','ArtsBeat: ‘The Nightmare Dream’','By ANITA GATES','http://artsbeat.blogs.nytimes.com/2013/08/16/new-york-fringe-festival-report-the-nightmare-dream/?partner=rss&emc=rss','http://artsbeat.blogs.nytimes.com/2013/08/16/new-york-fringe-festival-report-the-nightmare-dream/','\0','2013-08-16 22:45:37','2013-08-19 10:10:18','Neal J. Freeman’s horror comedy mashes up “A Midsummer Night’s Dream” and vampire stories.',1),(4337,14,15,182,'5d1870a3d2f83786623816e9df2ae8897d464f88','Dance Review: Indian Dances at the Erasing Borders Festival','By ALASTAIR MACAULAY','http://www.nytimes.com/2013/08/17/arts/dance/indian-dances-at-the-erasing-borders-festival.html?partner=rss&emc=rss','http://www.nytimes.com/2013/08/17/arts/dance/indian-dances-at-the-erasing-borders-festival.html','\0','2013-08-16 22:24:56','2013-08-19 10:10:18','A two-hour concert on Thursday at the Erasing Borders festival at Battery Park featured five of the classical dance forms of India and one of its many folk forms.',1),(4338,14,15,182,'89f0050bbc3897d75a7737b0ed2428583b5f72e8','For the Met, Opera History Lives in a Newark Parking Lot','By JAMES BARRON','http://www.nytimes.com/2013/08/17/arts/music/for-the-met-opera-history-lives-in-a-newark-parking-lot.html?partner=rss&emc=rss','http://www.nytimes.com/2013/08/17/arts/music/for-the-met-opera-history-lives-in-a-newark-parking-lot.html','\0','2013-08-16 22:22:05','2013-08-19 10:10:18','The Met stores the sets of about 100 different productions 